<!DOCTYPE html>
<html lang="es">

<head>
  <meta charset="UTF-8">
  <title>Monitor de Turnos - SICAM</title>
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <!-- Bootstrap 5 CDN -->
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css" rel="stylesheet">
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/@splidejs/splide@4.1.4/dist/css/splide.min.css">
  <link href="style.css" rel="stylesheet">
</head>

<body>
  <div class="container-fluid vh-100 bg-light">
    <!-- HEADER -->
    <div class="row m-0 px-2 py-2 align-items-center" style="height: 45vh; min-height: 150px;">
      <!-- Slider colas (izquierda) -->
      <div class="col-12 col-md-7 d-flex justify-content-start align-items-center">
        <div id="colasSlider" class="splide w-100 h-100">
          <div class="splide__track h-100">
            <ul class="splide__list h-100" id="sliderColas">
              <!-- Renderizado por JS (li.splide__slide) -->
            </ul>
          </div>
        </div>
      </div>

      <!-- YouTube player (derecha) -->
      <div class="col-12 col-md-4 d-flex justify-content-end align-items-center pe-0">
        <div class="ratio ratio-16x9 w-100" style=" min-width: 220px;">
          <iframe id="videoPlayList" src="https://www.youtube.com/embed/brZEANdIKMU?list=PLy0Q2cGnTqFu0FolcBCIeQI9aJK3EFVeT&index=3&enablejsapi=1"
            allowfullscreen></iframe>
        </div>
      </div>
    </div>
    <!-- TABLA TURNOS EN ATENCIÓN -->
    <div class="row m-0 p-3" style="height: 50vh; min-height: 300px;">
      <div class="col-12">
        <div class="card shadow-lg rounded-4 h-100 d-flex flex-column">
          <div class="card-header bg-primary text-white">
            <h4 class="mb-0">Turnos en Atención</h4>
          </div>
          <div class="card-body p-0 flex-grow-1">
            <div id="tablaAtencionWrapper" class="h-100">
              <table class="table table-hover align-middle mb-0">
                <thead>
                  <tr>
                    <th>Módulo</th>
                    <th>Código Turno</th>
                    <th>Nombre</th>
                  </tr>
                </thead>
                <tbody id="tablaAtencion">
                  <!-- Renderizado por JS -->
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
    <!-- MODAL LLAMADO -->
    <div class="modal fade" id="llamadoModal" tabindex="-1" aria-hidden="true">
      <div class="modal-dialog modal-fullscreen">
        <div class="modal-content bg-dark text-white text-center">
          <div class="modal-body d-flex flex-column justify-content-center align-items-center" style="height: 90vh;">
            <h1 class="display-1 fw-bold mb-4">¡Turnos en Llamado!</h1>
            <div id="llamadosActivos" class="w-100 d-flex flex-wrap justify-content-center gap-4">
              <!-- Renderizado por JS -->
            </div>
          </div>
        </div>
      </div>
    </div>
    <!-- BARRA INFERIOR DE INFORMACIÓN DE SEDE / ZONA -->
    <div class="row m-0 px-2 pt-2 pb-1" style="height: 1vh;">
      <div class="col-12 d-flex justify-content-between align-items-center">
        <button id="btnConfigMonitor"
          data-bs-toggle="modal"
          data-bs-target="#configModal">
          <!-- Aquí va tu icono -->
          <img src="https://cdnsicam.net/img/logo.png" alt="Configurar" style="width: 30px; height: 30px;">
        </button>
        <div>
          <strong>Sede:</strong> <span id="infoSede">Sin configurar</span> |
          <strong>Zona de atención:</strong> <span id="infoZona">Sin configurar</span>
        </div>
      </div>
    </div>
  </div>
  <!-- MODAL CONFIGURACIÓN SEDE / ZONA -->
  <div class="modal fade" id="configModal" tabindex="-1" aria-hidden="true">
    <div class="modal-dialog">
      <div class="modal-content">
        <form id="formConfigPantalla">
          <div class="modal-header">
            <h5 class="modal-title">Configuración de pantalla</h5>
            <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Cerrar"></button>
          </div>
          <div class="modal-body">
            <div class="mb-3">
              <label for="configSede" class="form-label">Sede</label>
              <select class="form-select" id="configSede">
                <option value="">Selecciona una sede...</option>
              </select>
            </div>
            <div class="mb-3">
              <label for="configZona" class="form-label">Zona de atención</label>
              <select class="form-select" id="configZona">
                <option value="">Selecciona la zona...</option>
              </select>
            </div>
          </div>
          <div class="modal-footer">
            <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Cerrar</button>
            <button type="submit" class="btn btn-primary">Guardar</button>
          </div>
        </form>
      </div>
    </div>
  </div>


  <!-- Bootstrap Bundle + Popper -->
  <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/js/bootstrap.bundle.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/js/bootstrap.bundle.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/@splidejs/splide@4.1.4/dist/js/splide.min.js"></script>
  <script src="https://www.youtube.com/iframe_api"></script>
  <script src="turnos.js"></script>



  <audio controls id="vozCaidaInternet" src="data:audio/mpeg;base64,">
    The “audio” tag is not supported by your browser.
  </audio>

  <script>
    document.addEventListener("DOMContentLoaded", function() {
      setTimeout(() => {

        var audio = document.getElementById('vozCaidaInternet');
        if (audio) {
          // Intenta reproducir el audio automáticamente
          audio.play().catch(function(err) {
            // Si el navegador bloquea el autoplay, puedes manejar el error aquí
            // Por ejemplo, mostrar un mensaje o intentar un segundo play tras interacción de usuario
            console.log("Autoplay bloqueado:", err);
          });
        }

      }, 1234);

    });
  </script>



</body>

</html>